  `brand_id` int(0) NULL DEFAULT NULL COMMENT '品牌ID',
  `number_of_boxes` int(0) NULL DEFAULT NULL COMMENT '箱数量',
  `ink_quantity` int(0) NULL DEFAULT NULL COMMENT '墨量',
  `page_number` int(0) NULL DEFAULT NULL COMMENT '页数',
